text:
EXO Jersey numbers including the ex-members. 

EXO K leader, Suho’s number, is 1, because he is a leader; Kris is 00, because he was a EXO M leader and together with Suho, the number is 100;

Xiumin’s number ( MInseok ) is 99 because he is a oldest member and it represents he well, because there is no larger number than this one with two digits and his number is the last before 100.

Luhan’s number was 7 because, 7 was Christiano Ronaldo's shirt in Real Madrid , his idol;

Lay’s number is 10, because his birthday is in October;

Chen’s number is 21 because his birthday is in 21st september;

Sehun’s number is 94 because he born in 1994;

D.O’s number is 12 because his birthday is 12nd January and 12 were the EXO members;

Baekhyun’s number is 4 because one of Baekhyun's favorite sports is baseball, and the fourth person responsible for the offense is of great importance to the team;

Chanyeol’s number is 61 because it is the number that belongs to his baseball idol, Park Chan Ho;

Kai”s number is 88 because 8 is the letter H in alphabet, so HH means hip hop and 88 days is the difference for Sehun’s birthday.

Tao’s number was 68 added together, the digits make 14, the date on which his 2nd teaser was released.
